aux.text:
(* Remove Instances *)
OGSet.StringRepOptions'PI( fn (CPN'page, CPN'place, CPN'inst) => CPN'place);
OGSet.StringRepOptions'TI( fn (CPN'page, CPN'trans, CPN'inst) => CPN'trans);
(* Remove Empty Places *)
OGSet.StringRepOptions'Mark( fn (CPN'PI, CPN'mark) => if CPN'mark="empty" orelse CPN'mark="tempty" then "" else CPN'PI^": "^CPN'mark^"\n");

OGSet.StringRepOptions'PI(
fn (CPN'page, CPN'place, CPN'inst) => CPN'page^"'"^CPN'place^" "^CPN'inst);

OGSet.StringRepOptions'TI(
fn (CPN'page, CPN'trans, CPN'inst) => CPN'page^"'"^CPN'trans^" "^CPN'inst);

globdecl.text:
color U = with p | q; ;
color E = with e;
var x : U;
